import { SharedModule } from 'app/shared/shared.module';
import { NgModule, CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';
import { DataEntryService } from './payroll-verifier/data-entry/service/data-entry.service';
import { WorkloadInboxService } from './service/workload-inbox.service';
import { WorkLoadInboxResolvePagingParams, WorkLoadInboxRoute } from './workload-inbox.route';
import { RouterModule } from '@angular/router';
import { DataEntryComponent } from './payroll-verifier/data-entry/data-entry.component';
import { PayrollNotificationComponent } from './payroll-verifier/payroll-notification/payroll-notification.component';
import { PayrollRejectionComponent } from './payroll-verifier/payroll-rejection/payroll-rejection.component';
import { PayrollRejectionHistoryComponent } from './payroll-verifier/payroll-rejection-history/payroll-rejection-history.component';
import { ClaimInboxComponent } from './claim-verifier/claim-inbox/claim-inbox.component';
import { ConfirmationService, MessageService } from 'primeng/api';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';
import { WorkloadInboxComponent } from './workload-inbox.component';
import { DateUtilsService } from 'app/core/util/date-utils.service';

import { ClaimVerifierInboxComponent } from './claim-approver/claim-verifier-inbox/claim-verifier-inbox.component';
import { SerbInboxComponent } from './claim-approver/serb-inbox/serb-inbox.component';
import { AppealInboxComponent } from './claim-approver/appeal-inbox/appeal-inbox.component';
import { ClaimApproverInboxComponent } from './claim-approver/claim-approver-inbox/claim-approver-inbox.component';
import { ClaimApproverComponent } from './claim-approver/claim-approver-component';
import { AssignClaimsComponent } from './claim-approver/claim-verifier-inbox/assign-claims/assign-claims.component';
import { DialogService } from 'primeng/dynamicdialog';
import { AssignClaimsAutoComponent } from './claim-approver/claim-verifier-inbox/assign-claims-auto/assign-claims-auto.component';
import { PayrollApproverInboxComponent } from './payroll-approver/payroll-approver-inbox/payroll-approver-inbox.component';
import { PersonalAvailabilityComponent } from './personal-availability/personal-availability.component';
import { VerifierAvailabilityComponent } from './verifier-availability/verifier-availability.component';
import { PayrollNotificationHistoryComponent } from './payroll-verifier/payroll-notification-history/payroll-notification-history.component';
import { IcCodeService } from 'app/ng-connect';
import { NewEcComponent } from './payroll-verifier/new-ec/new-ec.component';
import { NewSeComponent } from './payroll-verifier/new-se/new-se.component';
import { SuppportingDocumentComponent } from './payroll-verifier/suppporting-document/suppporting-document.component';
import { PayrollApproverComponent } from './payroll-verifier/payroll-approver/payroll-approver.component';
import { EditHardcopyEcComponent } from '../claim/ec-claim/edit-hardcopy-ec/edit-hardcopy-ec.component';
import { CommonModule } from '@angular/common';

const ENTITY_STATES = [...WorkLoadInboxRoute];

@NgModule({
  imports: [
    SharedModule,
    RouterModule.forChild(ENTITY_STATES),
  ],
  declarations: [
    WorkloadInboxComponent,
    DataEntryComponent,
    PayrollNotificationComponent,
    PayrollRejectionComponent,
    PayrollRejectionHistoryComponent,
    ClaimInboxComponent,
    ClaimApproverInboxComponent,
    ClaimVerifierInboxComponent,
    SerbInboxComponent,
    AppealInboxComponent,
    ClaimApproverComponent,
    AssignClaimsComponent,
    AssignClaimsAutoComponent,
    PayrollApproverInboxComponent,
    PersonalAvailabilityComponent,
    VerifierAvailabilityComponent,
    PayrollNotificationHistoryComponent,
    NewEcComponent,
    NewSeComponent,
    SuppportingDocumentComponent,
    PayrollApproverComponent,
  ],
  entryComponents: [],
  providers: [WorkloadInboxService, WorkLoadInboxResolvePagingParams, DataEntryService,ConfirmationService,
    MessageService, ConfirmationService, NspConfirmationService, DateUtilsService,
  DialogService,IcCodeService],
  // exports: [DataEntryModule],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
})
export class WorkloadModule {}
